import React, { Component } from "react";
import "./App.css"
import Nav from "./components/Nav/nav";
import Landing from ".components/Landing/landing"
import { BrowserRouter, Route } from "react-router-dom";

class App extends Component {
  render() {
  	return (<>
      <Nav />
      <Landing />
    </>);
  };
};

export default App;
